import re
import time
from pyVmomi import vim, vmodl
from app.vmware_exp.examples import vcenter_utils


def extract_username(user):
    if "@" in user:
        username = user[0:user.lower().strip().find("@")]
    elif "\\" in user:
        username = user[user.lower().strip().find("\\") + 1:]
    else:
        username = user

    return username

def get_user_priviliges(full_user_name):
    try:

        si = vcenter_utils.connect_vcenter()
        content = si.RetrieveContent()
        auth_mgr = content.authorizationManager
        permissions = auth_mgr.RetrieveAllPermissions()
        user_name = extract_username(full_user_name)
        print ("Retrieving all the available permissions: {permissions}")
        for permission in permissions:
            user = permission.principal
            #print(f'........user: {user}')

            vc_user = extract_username(user)
            #print(f'........vc_user: {vc_user}')

            # Get the Role ID.
            if user_name.lower() == vc_user.lower():
                role_id = permission.roleId
                #print(f"User: {user_name}, Role ID: {role_id}")
                break

        # From the vCenter API we will get only the User/Group which is added
        # in the Global permissions ie. the permissions are given at
        # Group level not user level. So if user is a member of a group
        # and only group is added in global permissions then we need to
        # validate the user against the root folder.
        privileges = []
        if role_id:
            print("Retrieving all the available user roles...")
            user_roles = auth_mgr.roleList
            #print(f'........user roles: {user_roles}')

            for user_role in user_roles:
                if user_role.roleId == role_id:
                    privileges = user_role.privilege
                    print(f'........user role: {role_id}, privileges: {privileges}')
                    break
        else:
            mo_refs = [content.rootFolder] #[get_datacenters_root_folder()]
            privileges = \
                auth_mgr.FetchUserPrivilegeOnEntities(
                    entities=mo_refs, userName=user_name)
            print(f'........rootFolder: {mo_refs}, privileges: {privileges}')

    except Exception as error:
        raise error


if __name__ == '__main__':
    user = "administrator@vsphere.local"
    user = "admin2@vsphere.local"

    get_user_priviliges(user)


